import React from "react";
import '../styles/contact.css'

const contactDeets = [
    {
        method: "E-mail",
        link: "eschase4@gmail.com",
    },
    {
        method: "LinkedIn",
        link: "https://www.linkedin.com/in/eli-chase-16b146256/",
    },
    {
        method: "GitHub",
        link: "https://github.com/eschase4",
    },
]

function handleSubmit(e) {
    e.preventDefault()
    // const emailName = document.getElementById('#emailName')
    console.log(e.target.body)
}

function Contact() {
    return (
        <div id="contact">
            <div className="container">
                <div className="titleCard">
                    <h3>Contact</h3>
                </div>
                <h4>Email</h4>
                <form className="emailForm">
                    <p>Name: <input type="text" id="emailName"></input></p>
                    <p>Email:   <input type="email"></input></p>
                    <button id="submitBtn" type="submit" onClick={handleSubmit}>Send</button>
                </form>
                <div>
                    <ul>
                        {contactDeets.map((item) => {
                            return (
                                <li><a href={item.link}>{item.method}</a></li>
                            )
                        })}
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Contact
